import React from 'react';

const QuestLog = () => {
  const projects = [
    {
      id: 1,
      title: "AR Adventure Game",
      description: "An immersive augmented reality game that blends real-world exploration with digital storytelling. Features real-time multiplayer interactions and location-based challenges.",
      technologies: ["Unity", "ARCore", "Photon PUN", "C#"],
      difficulty: "expert",
      icon: "üéÆ"
    },
    {
      id: 2,
      title: "VR Training Simulator",
      description: "A comprehensive VR training platform for industrial safety procedures. Includes realistic physics simulation and progress tracking systems.",
      technologies: ["Unity", "Oculus SDK", "SteamVR", "C#"],
      difficulty: "advanced",
      icon: "ü•Ω"
    },
    {
      id: 3,
      title: "Multiplayer Racing Game",
      description: "High-performance multiplayer racing game with real-time physics, custom vehicle customization, and cross-platform play support.",
      technologies: ["Unity", "Photon PUN", "C#", "MySQL"],
      difficulty: "expert",
      icon: "üèéÔ∏è"
    },
    {
      id: 4,
      title: "Mobile Puzzle Game",
      description: "A casual puzzle game with innovative mechanics and engaging progression systems. Achieved 100k+ downloads on app stores.",
      technologies: ["Unity", "C#", "Firebase", "AdMob"],
      difficulty: "intermediate",
      icon: "üß©"
    },
    {
      id: 5,
      title: "Educational VR App",
      description: "Interactive VR application for educational institutions, featuring 3D models, simulations, and collaborative learning environments.",
      technologies: ["Unity", "WebXR", "C#", "WebGL"],
      difficulty: "advanced",
      icon: "üìö"
    },
    {
      id: 6,
      title: "Social AR Platform",
      description: "A social media platform with AR filters and real-time face tracking. Includes user-generated content and community features.",
      technologies: ["Unity", "ARKit", "ARCore", "C#"],
      difficulty: "expert",
      icon: "üì±"
    }
  ];

  return (
    <section id="projects" className="game-section">
      <h2 className="section-title">Featured Projects</h2>
      <div className="achievement-gallery">
        {projects.map((project) => (
          <div key={project.id} className="quest-card" style={{ position: 'relative' }}>
            <div className="quest-badge">{project.icon}</div>
            <div className="quest-content">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <div style={{ display: 'flex', flexWrap: 'wrap', gap: '0.5rem', marginTop: '1rem' }}>
                {project.technologies.map((tech, index) => (
                  <span key={index} className="achievement">{tech}</span>
                ))}
              </div>
            </div>
            <div className={`difficulty-badge ${project.difficulty}`}>
              {project.difficulty}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default QuestLog;
